import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Create from './Pages/Create'
import Home from './Pages/Home'
import {} from './material-ui/'
function App() {
  return (
    <Router>
      <Switch>

        <Route exact path="/" >
          <Home />
        </Route>
        <Route path="/create">
       <Create/>
        </Route>

      </Switch>

    </Router>
  );
}

export default App;
